import React, { Component } from 'react'
import './location.css'

export class Location extends Component {
constructor() {
    super()
    this.state={
        city: '',
        currentCity: [],
        country: '',
        currentCountry: []
    }
}


    render() {
        return (
            <div>
                <p>City</p> 
                <p>Country</p>
            </div>
        )
    }
}

export default Location;
